import React from 'react';
import styled from 'styled-components';

const Styles = styled.div`

.info-window {
  background: white;
  padding: 3px;
  h1 {
    //font-size: 1.5em;
    padding: 0 0 5px;
  }
}
`

function Address() {
    return (
        <Styles className="info-window">
          <h1>Barber Andrew</h1>
          <h6>Orzechowa 50</h6>
          <h6>50-540 Wroc≈Çaw</h6>
        </Styles>
    );
}

export default Address;
